import React from 'react'
import './Photos.css'
import {Swiper, SwiperSlide} from 'swiper/react'
import 'swiper/css'
import ecommerce from '../../img/ecommerce.png'
import hoc from '../../img/hoc.png'
import sidebar from '../../img/sidebar.png'
import music from '../../img/musicapp.png'
import workkk from '../../img/workkk.png'


const swiper = new Swiper('.swiper', {
    // Default parameters
    slidesPerView: 1,
    spaceBetween: 10,
    // Responsive breakpoints
    breakpoints: {
      // when window width is >= 320px
      320: {
        slidesPerView: 2,
        spaceBetween: 20
      },
      // when window width is >= 480px
      480: {
        slidesPerView: 3,
        spaceBetween: 30
      },
      // when window width is >= 640px
      640: {
        slidesPerView: 4,
        spaceBetween: 40
      }
    }
  })

const Photos = () => {
  return (
    <div className="photos" id='Projects'>
        {/* heading */}
        <span>Recent Projects</span>
        <span>Works Completed</span>
        {/* Slider */}
        <Swiper
        spaceBetween={30}
        slidesPerView={1}

        grabCursor='true'
        className='photos-slider'
        >
            <SwiperSlide>
                <img src={sidebar} alt="" />
            </SwiperSlide>
            <SwiperSlide>
                <img src={music} alt="" />
            </SwiperSlide>
            <SwiperSlide>
                <img src={hoc} alt="" />
            </SwiperSlide>
            <SwiperSlide>
                <img src={ecommerce} alt="" />
            </SwiperSlide>
            <SwiperSlide>
                <img src={workkk} alt="" />
            </SwiperSlide>
        </Swiper>
        <div className="blur s-blur5" style={{background: 'var(--lblue)'}}></div>
        <div className="blur s-blur6" style={{background: 'var(--dblue)'}}></div>
    </div>
  )
}

export default Photos
